INSERT INTO wagtailcore_pagerevision VALUES(2,0,'{"pk": 3, "path": "00010001", "depth": 2, "numchild": 0, "title": "Home", "draft_title": "Home", "slug": "home", "content_type": 2, "live": true, "has_unpublished_changes": true, "url_path": "/home/", "owner": null, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": "2019-05-13T00:07:17.250Z", "live_revision": null, "banner_title": "Medina Diversity Project", "left_col": "<h2><b>Community Conversation on Race</b></h2><p><b>Monday, February 25, 2019 - 7:00 \u2013 8:30 PM</b></p><p>Medina First Christian Church<br/>4797 Sharon-Copley Rd.<br/>Medina, OH 44256</p>", "right_col": "<h3><b>The Medina Diversity Project is organized to embrace and promote social, cultural, and economic diversity throughout Medina County.</b></h3><p><i>The mission of the Medina Diversity Project will be accomplished through these objectives:</i></p><ol><li>Raise awareness in the community through conversations on race and diversity with members of the community and community leaders.</li><li>Advocate to increase employment opportunities for minorities in both the public (specifically in our schools, police departments, County and City governments) and the private sector.</li><li>Advocate to ensure that every child in Medina County, regardless of race or income level, feels safe and accepted in their environment and has the opportunity to participate in sports or other extracurricular activities in the schools and the community.</li></ol>", "banner_image": 1}',NULL,3,1,'2019-05-13 00:08:30.949864');
