INSERT INTO home_homepage VALUES(3,1,'Medina Diversity Project','<h2><b>Community Conversation on Race</b></h2><p><b>Monday, February 25, 2019 - 7:00 – 8:30 PM</b></p><p>Medina First Christian Church<br/>4797 Sharon-Copley Rd.<br/>Medina, OH 44256</p>','<h3><b>The Medina Diversity Project is organized to embrace and promote social, cultural, and economic diversity throughout Medina County.</b></h3><p><i>The mission of the Medina Diversity Project will be accomplished through these objectives:</i></p><ol><li>Raise awareness in the community through conversations on race and diversity with members of the community and community leaders.</li><li>Advocate to increase employment opportunities for minorities in both the public (specifically in our schools, police departments, County and City governments) and the private sector.</li><li>Advocate to ensure that every child in Medina County, regardless of race or income level, feels safe and accepted in their environment and has the opportunity to participate in sports or other extracurricular activities in the schools and the community.</li></ol>');
